import React,{useState} from 'react';
import logo from '../logo.svg';

function Navbar(props){
	const [login, setLogin]=useState(true);
	const [showMenu, setShowMenu]=useState(false);

	return(
		<div className='NavbarDiv'>
			<img className='logo' scr={logo} alt='logo'/>
			<h3 font-family='Brush Script MT' className='Navhead'>Save Your Time</h3>

			{login?<div className='msg-menu-div'>
				<button>Messages</button>
				<button onClick={()=>{showMenu?setShowMenu(false):setShowMenu(true)}}
				>{showMenu?'X':'Menu'}</button>
			</div>:<div className='msg-menu-div'>
				<button>LOGIN</button>
				<button>SIGNUP</button>
			</div>}

			{showMenu?<div className='menu'>
				<button>Account</button>
				<h3>CONNECT WITH US THROUGH</h3>
				<ul>
					<li><a href='mailto:sumitdhakad2232@gmail.com'>Mail</a></li>
					<li><a href='https://www.facebook.com/sumit.dhakad.7587'>Phone Call</a></li>
					<li><a href='https://www.facebook.com/sumit.dhakad.7587'>Linkedin</a></li>
					<li><a href='https://www.facebook.com/sumit.dhakad.7587'>Instagram</a></li>
					<li><a href='https://www.facebook.com/sumit.dhakad.7587'>Facebook</a></li>
				</ul>
				<button>Logout</button>
				<button>About us</button>
				<a href='https://association-yug.com'>ABOUT OUR GROUP</a>
				<h2>BY</h2>
				<h2>ASSOCIATION YUG</h2>
			</div>:''}
		</div>	
	);
}


export default Navbar;
